window.bookSummaryJSON = "<p>Her body belongs to everyone, but her soul is mine.</p> <p>Patrons call her leska, female, using her body in ways that leave the human in bruises and blood. Each night, I stitch her back together, tend to her wounds, only to watch another male tear them open with pleasure.</p> <p>Sophie. That’s what I call her when no one is listening, that human female abducted from Earth to be seeded by many. I want to save her, but I can barely save myself, chasing my next score with no consideration for anyone - not even her.</p> <p>Each day I pledge I’ll save her.</p> <p>Each day I let her down.</p> <p>I mean every promise I make her, but I don’t keep a single one.</p> <p>Until an opportunity arises, bringing us face to face with our worst enemy: myself.</p> <p>Saved is the fourth book in this interconnected romance series, bringing you an alien invasion in its most authentic way. If you enjoy strong women, devoted aliens, fated mates, and hard-earned happily ever after’s with no insta-love, Stockholm syndrome, or cliffhangers, you’ll love Garrison Earth.</p> <p>Author Note: The entire Garrison Earth series touches on subjects such as captivity, drug abuse, forced prostitution, loss of loved ones, human trafficking, rough handling, and violence. Any reader uncomfortable with the harsh realities of an alien invasion should please consider before purchase.</p>"; 
